import React, { useState, useEffect }  from 'react';
import { Modal, Container, Row } from 'react-bootstrap';
import { BASE_URL } from './config/api';

import './Login.css';


const form = document.querySelector('.form');
const firstname = document.querySelector('#firstname');
const lastname = document.querySelector('#lastname');
const userna = document.querySelector('#email');
const password = document.querySelector('#password');

form.addEventListener('submit', submitForm);


function Login() {

 window.addEventListener('load', function() {
    // Fetch all the forms we want to apply custom Bootstrap validation styles to
    var forms = document.getElementsByClassName('needs-validation');
    // Loop over them and prevent submission
    var validation = Array.prototype.filter.call(forms, function(form) {
      form.addEventListener('submit', function(event) {
        if (form.checkValidity() === false) {
          event.preventDefault();
          event.stopPropagation();
        }
        form.classList.add('was-validated');
      }, false);
    });
  }, false);

    return (
       <>
        <Container>
            <h1 className="mb-5 pb-5">Login</h1>
            <form className=" form needs-validation" novalidate="novalidate">
                <div className="form-row">
                    <div id="firstname" className="col-md-6 mb-3">
                        <label for="validationCustom01">First name</label>
                        <input
                            type="text"
                            className="form-control"
                            id="validationCustom01"
                            required="required"/>
                        <div className="valid-feedback">
                            Looks good!
                        </div>
                    </div>

                    <div  id="lastname" className="col-md-6 mb-3">
                        <label for="validationCustom02">Last name</label>
                        <input
                            type="text"
                            className="form-control"
                            id="validationCustom02"
                            required="required"/>
                        <div className="valid-feedback">
                            Looks good!
                        </div>
                    </div>
                        <div id="email" className="col-md-6 mb-3">
                            <label for="validationCustom03">Email</label>
                            <input
                                type="text"
                                className="form-control"
                                id="validationCustom03"
                                required="required"/>
                            <div className="valid-feedback">
                                Looks good!
                            </div>
                        </div>
                </div>
                <button className="btn btn-primary" type="submit">Submit form</button>
            </form>
        </Container>
       </>
    )
}


export default Login;
